// Split input items into batches of 50 and add batchNumber
const batchSize = 100;
const inputItems = $input.all();
let output = [];

for (let i = 0; i < inputItems.length; i++) {
  const batchNumber = Math.floor(i / batchSize) + 1;
  const item = inputItems[i];
  output.push({
    json: {
      ...item.json,
      batchNumber,
    }
  });
}

return output;
